INSERT INTO `aula` (`ID_AULA`, `COD_MAT`, `N_PRESENCAS`, `DATA`, `TITULO`, `COMENTARIO`, `STATUS`) VALUES
(4, 1, 2, '2023-11-01', 'Introdução ao Mundo dos Bancos de Dados', 'Explore os fundamentos dos bancos de dados, conceitos-chave e a importância do gerenciamento eficiente de dados para sistemas de informação.', 'NAO REALIZADA'),
(5, 1, 2, '2023-11-03', 'Modelagem de Dados: Teoria e Prática', 'Aprofunde-se na arte da modelagem de dados, abordando modelos conceituais, lógicos e físicos, utilizando ferramentas modernas para design de bancos de dados.', 'NAO REALIZADA'),
(6, 1, 2, '2023-11-08', 'SQL: Dominando a Linguagem de Consulta Estruturada', 'Desenvolva habilidades práticas em SQL, desde consultas básicas até operações avançadas de manipulação e gerenciamento de dados.', 'NAO REALIZADA'),
(7, 2, 2, '2023-11-01', 'Explorando Componentes de Hardware: Uma Jornada pelo Interior do Computador', 'Esta aula oferece uma imersão prática nos principais componentes de hardware, desde placas-mãe e processadores até dispositivos de armazenamento, proporcionando uma compreensão abrangente da arquitetura de um computador.', 'NAO REALIZADA'),
(8, 2, 2, '2023-11-02', 'Montagem e Manutenção de Computadores: Do Zero à Manutenção Preventiva', 'Aprenda a montar computadores passo a passo, compreendendo não apenas a construção, mas também as práticas essenciais de manutenção preventiva para garantir o desempenho e a durabilidade dos sistemas.', 'NAO REALIZADA'),
(9, 2, 2, '2023-11-08', 'Diagnóstico e Solução de Problemas: Técnicas Avançadas em Laboratório', 'Desenvolva habilidades avançadas de solução de problemas em hardware, utilizando ferramentas de diagnóstico e técnicas práticas para identificar e corrigir uma variedade de problemas comuns.', 'NAO REALIZADA'),
(10, 3, 4, '2023-11-03', 'Fundamentos da Lógica de Programação: Construindo a Base para o Desenvolvimento de Sistemas', 'Nesta aula introdutória, os alunos mergulharão nos conceitos fundamentais da lógica de programação, desenvolvendo habilidades essenciais para a construção de algoritmos eficientes.', 'NAO REALIZADA'),
(11, 3, 4, '2023-11-10', 'Estruturas de Controle: Tomando Decisões e Iterando no Mundo da Programação', 'Explore estruturas de controle, como condicionais e loops, aprendendo a criar algoritmos que tomam decisões e repetem tarefas, essenciais para a construção de lógica eficaz em programação.', 'NAO REALIZADA'),
(12, 3, 4, '2023-11-17', 'Funções e Procedimentos: Modularizando o Código para Maior Eficiência', 'Aprofunde-se na criação de funções e procedimentos, descobrindo como modularizar o código para promover a reutilização e a manutenibilidade, aspectos cruciais no desenvolvimento de sistemas complexos.', 'NAO REALIZADA');

